import React from 'react';
import {Route, Switch} from 'react-router-dom';
import Header from './components/Header';
import CovidVideos from './components/covidVideos';
import OtherVideos from './components/otherVideos';
const App = () =>{
    return(
        <Switch>
            <Route exact path="/" component={CovidVideos} />
            <Route path="/:id" component={OtherVideos} />
        </Switch>
    );
}
export default App;
